import React from 'react'

const todos =[
    {
        "title" : "Titas",
        "desc" : " Titas a name of River"
    },
    {
        "title" : "Megna",
        "desc" : " People called Megna is mother of Titash"
    },
    {
        "title" : "Padma",
        "desc" : " Padma is biggest river of Bangladesh "
    }
    
]


function List() {
  return (
    <div>
        {todos.map((todo,index)=>{
            return(
                <div key = {index}>
                    <h1>{todo.title}</h1>
                    <p>{todo.desc}</p>
                </div>
            )
        })}
    </div>
  )
}

export default List
